import React from 'react'
import AllData from './Musicdata.json';

const Music = () => {
  const data=[];
  const getall=()=>{
    AllData.map((fidata,index)=>{
      data[index]=AllData[index];
      console.log(data);
    })
  }
  const getart=()=>{
    AllData.filter((fidata)=>{
      return fidata.music_name==="Music Art Super Item";
    })
    data=AllData;
  }
  return (
    <div className='music'>
      <div className="container">
        <div className="btns">
          <button
          onClick={getall}
          >All items</button>
          <button
          onClick={getart}
          >Music Art</button>
          <button>Digital Art</button>
          <button> Block Art</button>
          <button>Blockchain</button>
          <button>Virtual</button>
        </div>
        <h1>items currently in the market</h1>
        <div className="row text-light">
          {
            data.map((df)=>{
              return <div>pa</div>
            })
          }
          {
            AllData.map((Data)=>{
              return(<div className='text-light'><p style={{color:'white'}}>{Data.end}</p></div>)
            })
          }
        </div>
      </div>
    </div>
  )
}

export default Music
